import React from 'react'
import axios from 'axios'



function App() {




  axios.get('https://api.coingecko.com/api/v3/global')
    .then(res => {
    //  console.log(res.data.data)
     const indivCurrencies = res.data.data.total_volume;
     console.log(indivCurrencies);
     indivCurrencies.forEach((currency) => {
       console.log(currency)
     })

    }).catch(error => {
      console.log(error);
    });


  return (
    <div >
    </div>
  );
}

export default App;
